import React from 'react';
import FilterButton from './FilterButton';

import { connect } from 'react-redux';

class FilteredResults extends React.Component {

    renderList = (filteredSubCategories = [])  => {
        return (
            <div>
                <FilterButton />
            </div>
            );
    }

    render() {
        return (
            <div>
				Result Buttons
			</div>
			);

    }
}

const mapStateToProps = (state) => {
    return (
        {
            selectedState: state.payload
        });
}

export default connect(mapStateToProps)(FilteredResults);
